import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';

const ProfessorCoursePage = () => {
  const [courses, setCourses] = useState([]);
  const [loading, setLoading] = useState(true);
  const navigate = useNavigate();
  const token = localStorage.getItem('token');

  useEffect(() => {
    const fetchCourses = async () => {
      try {
        const response = await axios.get('http://localhost:8090/api/courses/professor', {
          headers: { Authorization: `Bearer ${token}` }
        });
        setCourses(response.data);
        setLoading(false);
      } catch (error) {
        console.error('강의 목록 불러오기 실패:', error);
        setLoading(false);
      }
    };

    fetchCourses();
  }, [token]);

  const handleCourseClick = (courseId) => {
    navigate(`/professor/course/${courseId}`);  // 경로 수정
  };

  const getStatusColor = (status) => {
    switch (status) {
      case 'OPEN':
        return 'bg-yellow-100';
      case 'COMPLETED':
        return 'bg-green-100';
      case 'CANCELLED':
        return 'bg-red-100';
      default:
        return 'bg-gray-100';
    }
  };

  const getStatusText = (status) => {
    switch (status) {
      case 'OPEN':
        return '신청 중';
      case 'COMPLETED':
        return '승인됨';
      case 'CANCELLED':
        return '거절됨';
      default:
        return '상태 없음';
    }
  };

  if (loading) {
    return (
      <div className="flex justify-center items-center min-h-screen">
        <div className="text-xl">강의 목록을 불러오는 중...</div>
      </div>
    );
  }

  return (
    <div className="container mx-auto px-4 py-8">
      <div className="mb-8">
        <h1 className="text-3xl font-bold text-gray-800">내 강의 목록</h1>
        <p className="text-gray-600 mt-2">현재 담당하고 계신 강의 목록입니다.</p>
      </div>

      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
        {courses.map((course) => (
          <div
            key={course.id}
            onClick={() => handleCourseClick(course.id)}
            className="bg-white rounded-lg shadow-md hover:shadow-lg transition-shadow duration-300 cursor-pointer overflow-hidden"
          >
            <div className="p-6">
              <div className="flex justify-between items-start mb-4">
                <h2 className="text-xl font-semibold text-gray-800">{course.name}</h2>
                <span className={`px-3 py-1 rounded-full text-sm ${getStatusColor(course.status)}`}>
                  {getStatusText(course.status)}
                </span>
              </div>
              
              <div className="space-y-2">
                <p className="text-gray-600">
                  <span className="font-medium">과목 유형:</span> {course.courseType || '미지정'}
                </p>
                <p className="text-gray-600">
                  <span className="font-medium">담당 교수:</span> {course.professor || '미지정'}
                </p>
                <p className="text-gray-600 line-clamp-2">
                  {course.description || '강의 설명이 없습니다.'}
                </p>
              </div>

              <div className="mt-4 pt-4 border-t border-gray-200">
                <div className="flex justify-end">
                  <button 
                    className="px-4 py-2 bg-blue-600 text-white rounded hover:bg-blue-700 transition-colors duration-300"
                    onClick={(e) => {
                      e.stopPropagation();
                      handleCourseClick(course.id);
                    }}
                  >
                    강의실 입장
                  </button>
                </div>
              </div>
            </div>
          </div>
        ))}
      </div>

      {courses.length === 0 && (
        <div className="text-center py-12">
          <p className="text-xl text-gray-600">현재 담당하고 계신 강의가 없습니다.</p>
        </div>
      )}
    </div>
  );
};

export default ProfessorCoursePage;
